values:
Ok, Kiddies, guess it's time for concert talk.&nbsp; First off I'd like to say, I went to the show not to see KMFDM but to see CombiChrist.&nbsp; Not that I'm upset about KMFDM at all, no no no.&nbsp; In fact I left the HOB with a whole new appreciation for the band.&nbsp; They are truely amazing.&nbsp; I guess they'd have to be amazing to play a 23 song set, and no one gets bored at all.

But fuckin CombiChrist, was just simply.&nbsp; Amazing.&nbsp; Wonderful.&nbsp; They are my new favorite band.&nbsp; Andy L has spectacular stage presence.&nbsp; I was in awe.&nbsp; Not to mention, HE'S BEAUTIFUL.&nbsp; It was kinda funny, during "Enjoy the Abuse", Paul pulled on my dog collar the entire time as if to say "hey, this bitch enjoys the abuse."&nbsp; Anyways, about 4 or 5 times, andy left the stage, and stood on the railing and touched me.&nbsp; Well his crotch touched me.&nbsp; The only draw back of being in the very front.&nbsp; Oh wait, I lied, it also sucked having my ribs being smushed into the railing while 130984712904357825 people tried to take my sweet spot.&nbsp; 

Everyone go listen to CombiChrist
